function withdraw(uint256 tokenIndex) public payable {
    require(msg.sender == admin, "Only admin can call this function");

    require(tokenIndex < tokenCount, "Invalid token index");

    address tokenAddress = storage_map_t[tokenIndex * 2];
    address contractAddress = address(this);

    // Check balance of the contract for the token
    (bool balanceSuccess, bytes memory balanceData) = tokenAddress.staticcall(
        abi.encodeWithSignature("balanceOf(address)", contractAddress)
    );
    require(balanceSuccess, "Balance check failed");

    // Transfer tokens to the admin
    (bool transferSuccess, bytes memory transferData) = tokenAddress.call(
        abi.encodeWithSignature("transfer(address,uint256)", msg.sender, abi.decode(balanceData, (uint256)))
    );
    require(transferSuccess, "Transfer failed");
}

